DROP TABLE IF EXISTS `feedback_sd`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `feedback_sd` (
  `id` bigint unsigned NOT NULL AUTO_INCREMENT,
  `prepared_documents_id` bigint unsigned DEFAULT NULL,
  `document_evaluation_id` bigint unsigned DEFAULT NULL,
  `criteria_1` enum('Несвоевременно','Недостаточно своевременно','Своевременно') DEFAULT NULL COMMENT 'Критерий оценки направленного документа на своевременность',
  `criteria_2` enum('Не раскрыто','Недостаточно раскрыто','Раскрыто','Всесторонне раскрыто') DEFAULT NULL COMMENT 'Критерий оценки направленного документа на полноту раскрытия темы',
  `criteria_3` enum('Известно','Преимущественно неизвестно','Неизвестно') DEFAULT NULL COMMENT 'Критерий оценки направленного документа на новизну предоставляемой информации',
  `criteria_4` enum('Низкая','Средняя','Высокая') DEFAULT NULL COMMENT 'Критерий оценки направленного документа на значимость информации',
  PRIMARY KEY (`id`),
  UNIQUE KEY `id` (`id`),
  KEY `feedback_sd_FK_prepared_documents` (`prepared_documents_id`),
  KEY `feedback_sd_FK_document_evaluation` (`document_evaluation_id`),
  CONSTRAINT `feedback_sd_FK_document_evaluation` FOREIGN KEY (`document_evaluation_id`) REFERENCES `document_evaluation` (`id`) ON UPDATE CASCADE,
  CONSTRAINT `feedback_sd_FK_prepared_documents` FOREIGN KEY (`prepared_documents_id`) REFERENCES `prepared_documents` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=92 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

